const Card = (props) => {
   return (
     <div className="card">
       <div className="card-body">
         <h5 className="card-title"></h5>
         <p className="card-text">
           {props.post.body}
         </p>
         <Link href="#">
           <a className="btn btn-primary">Go somewhere</a>
         </Link>
       </div>
     </div>
   );
}

export default Card
